import './App.css';

function Button(text){
  return (
    <button> text </button>
  );
};

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Button text="bob" />
        <Button text="alice" />
        <Button text="charlie" />
        <Button text="david" />
        <Button text="eva" />
        <Button text="frank" />
        <Button text="george" />
        <Button text="hannah" />
        <Button text="ian" />
        <Button text="julia" />
      </header>
    </div>
  );
}

export default App;
